import React from "react";
import Nav from "../components/Nav";

function Contact(){
  return(
    <div >
      <h1>¡Vamos a trabajar juntos!
Si desea hablar sobre un proyecto con el que necesita ayuda o necesita un consejo sobre el diseño de productos, envíeme un mensaje a nathan@ojieame.design
. Actualmente estoy disponible para cualquier proyecto de sistemas de diseño, diseños de paneles o conciertos de páginas de destino. .</h1>
    </div>
  )
}

export default Contact;
